import React  from "react";
import './try.css'
function TelvinExample1() {
    return(

        <div>
            <img className="size" src="https://img.freepik.com/premium-photo/abundance-ful-fruit-perfect-dessert-basket-generated-by-ai_188544-14486.jpg?w=1060" class="relative max-w-screen-xl px-40" />
            <div className="absolute text-center text-3xl text-white font-bold mt-10">Fruit Basket</div>
        </div>

    )
}

export default TelvinExample1;
